import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";


import IndexButtons from './components/IndexButtons';
import 'bootstrap/dist/css/bootstrap.min.css';

function App (props) {
	return (

		<Router>
		 		<Switch>
					<Route path="/create-room">
						createRoom
					</Route>
				</Switch>
		</Router>
	);
}

export default App;
